const hostname = '192.168.0.9'
const port = '3000'
const path = '/AirconditionerControl/'

const pi_server_Url = require('./Pi_Url');
pi_server_Url.path = path;

/*
let pi_server_Url = {
    //hostname: '192.168.0.9,
